import Guess from "./Guess";

const CheckGuess = (words: string[], guess: Guess, idx: number): void => {
  const correctWord = words[idx];
  const tOrF =
    new Set(correctWord).size ===
    new Set(correctWord + guess.v + guess.c).size;
  console.log(tOrF);
};

export default CheckGuess;
